function find_target_index_in_sorted_rotated_array(nums, target) {
    var n = nums.length;
    var left_index = 0;
    var right_index = n - 1;
    while (left_index < right_index) {
        var mid_index = (left_index + right_index) >> 1;
        if (nums[0] <= nums[mid_index]) {
            if (nums[0] <= target && target <= nums[mid_index]) {
                right_index = mid_index;
            }
            else {
                left_index = mid_index + 1;
            }
        }
        else {
            if (nums[mid_index] < target && target <= nums[n - 1]) {
                left_index = mid_index + 1;
            }
            else {
                right_index = mid_index;
            }
        }
    }
    return (nums[left_index] == target) ? left_index : -1;
}
